selector_to_html = {"a[href=\"#equation-eq-korrelationskoefficient-est\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-korrelationskoefficient-est\">\n\\[    \\hat{\\rho} = \\frac{\\widehat{\\text{Cov}}(X,Y)}{\\sqrt{\\hat{\\sigma}^2_X \\hat{\\sigma}^2_Y}}.\\]</div>", "a[href=\"#estimation-af-korrelationskoefficient\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">34.2.1. </span>Estimation af korrelationskoefficient<a class=\"headerlink\" href=\"#estimation-af-korrelationskoefficient\" title=\"Permalink til denne overskrift\">#</a></h2><p>Som vi l\u00e6rte i Kapitel ??.?, s\u00e5 kan vi estimere vores momenter for stokastiske variabler empirisk.</p><p>Lad <span class=\"math notranslate nohighlight\">\\(x_1,x_2,\\dots,x_n\\)</span> v\u00e6re realiserede observationer fra en stokastisk variabel <span class=\"math notranslate nohighlight\">\\(X\\)</span>. Da har vi f\u00f8lgende estimatorer for momenterne for <span class=\"math notranslate nohighlight\">\\(X\\)</span>:</p>", "a[href=\"#equation-eq-korrelationskoefficienten-def\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-korrelationskoefficienten-def\">\n\\[    \\rho = \\text{Corr}(X,Y) = \\frac{\\text{Cov}(X,Y)}{\\sqrt{\\text{Var}(X)\\text{Var}(Y)}}.\\]</div>", "a[href=\"#equation-eq-andet-moment-est\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-andet-moment-est\">\n\\[    \\text{Var}(X):\\qquad \\hat{\\sigma}^2 = \\frac{1}{n}\\sum_{i=1}^n (\\bar{x}-x_i)^2.\\]</div>", "a[href=\"#equation-eq-kovarians-moment-est\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-kovarians-moment-est\">\n\\[    \\text{Cov}(X,Y):\\qquad \\widehat{\\text{Cov}}(X,Y) = \\frac{1}{n}\\sum_{i=1}^n (\\bar{x}-x_i)(\\bar{y}-y_i).\\]</div>", "a[href=\"../Stokastiske_variabler_II/momenter.html#ch-momenter\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">33.4. </span>Momenter<a class=\"headerlink\" href=\"#momenter\" title=\"Permalink til denne overskrift\">#</a></h1>", "a[href=\"#korrelationskoefficienten-ii\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">34.1. </span>Korrelationskoefficienten II<a class=\"headerlink\" href=\"#korrelationskoefficienten-ii\" title=\"Permalink til denne overskrift\">#</a></h1><p>I <a class=\"reference internal\" href=\"../../Del_2/Regression_I/datamaessige-sammenhaenge.html#ch-korrelationskoefficienten-i\"><span class=\"std std-numref\">Kapitel 25.1.2</span></a> stiftede vi bekendtskab med korrelationskoefficienten <span class=\"math notranslate nohighlight\">\\(\\rho\\)</span>. Vi vil i dette kapitel fors\u00f8ge at komme denne st\u00f8rrelse lidt n\u00e6rmere matematisk og ligeledes se, hvordan denne kan estimeres med data.</p>", "a[href=\"#equation-eq-kovarians2\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-kovarians2\">\n\\[    \\text{Cov}(X,Y) = \\mathbb{E}[XY] - (\\mathbb{E}[X]\\mathbb{E}[Y])^2.\\]</div>", "a[href=\"../Stokastiske_variabler_II/stokastiske-variabler-ii.html#ch-stokastiske-variabler-ii\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">33. </span>Stokastiske variabler II<a class=\"headerlink\" href=\"#stokastiske-variabler-ii\" title=\"Permalink til denne overskrift\">#</a></h1>", "a[href=\"../../Del_2/Regression_I/datamaessige-sammenhaenge.html#hoejde-og-skostoerrelse-scatter\"]": "<div class=\"proof eksempel admonition\" id=\"hoejde-og-skostoerrelse-scatter\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 25.1 </span></p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Vi f\u00e5r til opgave at unders\u00f8ge, om der er en sammenh\u00e6ng mellem h\u00f8jder og skost\u00f8rrelser p\u00e5 elever i en klasse p\u00e5 et gymnasium. Vi indsamler f\u00f8lgende data</p>\n<table class=\"colwidths-auto table\">\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>H\u00f8jde i cm</p></th>\n<th class=\"head\"><p>Skost\u00f8rrelse</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p>182.3</p></td>\n<td><p>43</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>184.4</p></td>\n<td><p>44</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>168.1</p></td>\n<td><p>39</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>165.4</p></td>\n<td><p>37</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>164.7</p></td>\n<td><p>37</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>172.1</p></td>\n<td><p>40</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>191.4</p></td>\n<td><p>46</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>197.8</p></td>\n<td><p>46</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>187.9</p></td>\n<td><p>44</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>182.1</p></td>\n<td><p>42</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>182.6</p></td>\n<td><p>43</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>188.2</p></td>\n<td><p>44</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>190.0</p></td>\n<td><p>45</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>181.7</p></td>\n<td><p>42</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>169.4</p></td>\n<td><p>39</p></td>\n</tr>\n</tbody>\n</table>\n<p>Vi lader nu H\u00f8jde i cm v\u00e6re variablen langs <span class=\"math notranslate nohighlight\">\\(x\\)</span>-aksen og Skost\u00f8rrelse v\u00e6re variablen langs <span class=\"math notranslate nohighlight\">\\(y\\)</span>-aksen.</p>\n<figure class=\"align-default\">\n<img alt=\"../../../_images/e47eb10edf7e204f4e2f0d92ba596c1627779bb7270ab27e0dc46f67f63d2dff.png\" src=\"../../../_images/e47eb10edf7e204f4e2f0d92ba596c1627779bb7270ab27e0dc46f67f63d2dff.png\"/>\n</figure>\n<p>Af scatterplottet bliver det tydeligt, at der er en tendens: Elever, der er h\u00f8jere, bruger ogs\u00e5 st\u00f8rre sko.</p>\n</section>\n</div>", "a[href=\"#equation-eq-foerste-moment-est\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-foerste-moment-est\">\n\\[    \\mathbb{E}[X]:\\qquad \\bar{x} = \\frac{1}{n}\\sum_{i=1}^n x_i,\\]</div>", "a[href=\"#equation-eq-kovarians1\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-kovarians1\">\n\\[    \\text{Cov}(X,Y) = \\mathbb{E}[(X-\\mathbb{E}[X])(Y - \\mathbb{E}[Y])].\\]</div>", "a[href=\"../../Del_2/Regression_I/datamaessige-sammenhaenge.html#ch-korrelationskoefficienten-i\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">25.1.2. </span>Korrelationskoefficienten I<a class=\"headerlink\" href=\"#korrelationskoefficienten-i\" title=\"Permalink til denne overskrift\">#</a></h2><p>Sammenh\u00e6ng i vores data kan ogs\u00e5 kvantificeres gennem korrelation. Korrelationskoefficienten er et tal, der siger noget om, hvordan den ene variabel opf\u00f8rer sig i forhold til den anden variabel. Tallet ben\u00e6vnes ofte med det gr\u00e6ske bogstav <span class=\"math notranslate nohighlight\">\\(\\rho\\)</span> (udtales \u00bbrho\u00ab).</p><p>I vores eksempel fra f\u00f8r havde vi, at n\u00e5r den ene variabel var st\u00f8rre, s\u00e5 var den anden variabel ogs\u00e5 st\u00f8rre. Vi siger, at de to variabler er <em>positivt korrelerede</em>. Det modsatte tilf\u00e6lde kan du ogs\u00e5 st\u00f8de p\u00e5. N\u00e5r en variabel bliver mindre, mens den anden variabel bliver st\u00f8rre, s\u00e5 er de to variabler <em>negativt korrelerede</em>. Hvis to variabler udvikler uden en tendens med hinanden, s\u00e5 vil de to variabler v\u00e6re <em>ukorrelerede</em>.</p>", "a[href=\"#kovarians\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">34.2. </span>Kovarians<a class=\"headerlink\" href=\"#kovarians\" title=\"Permalink til denne overskrift\">#</a></h1><p>I <a class=\"reference internal\" href=\"../Stokastiske_variabler_II/momenter.html#ch-momenter\"><span class=\"std std-numref\">Kapitel 33.4</span></a> l\u00e6rte vi om momenterne for en stokastisk variabel med en underliggende sandsynlighedsfordeling. N\u00e5r vi arbejder med to variabler simultant, s\u00e5 kan det v\u00e6re, at variablerne varierer med hinanden. Det var blandt andet det, som vi s\u00e5 i <a class=\"reference internal\" href=\"../../Del_2/Regression_I/datamaessige-sammenhaenge.html#hoejde-og-skostoerrelse-scatter\">Eksempel 25.1</a> med elevers h\u00f8jde og skost\u00f8rrelse. Bruger vi terminologien fra <a class=\"reference internal\" href=\"../Stokastiske_variabler_II/stokastiske-variabler-ii.html#ch-stokastiske-variabler-ii\"><span class=\"std std-numref\">Kapitel 33</span></a>, s\u00e5 var unders\u00f8gelsen fra <a class=\"reference internal\" href=\"../../Del_2/Regression_I/datamaessige-sammenhaenge.html#hoejde-og-skostoerrelse-scatter\">Eksempel 25.1</a> observationer, eller snarere <em>realisationer</em>, fra to stokastiske variabler <span class=\"math notranslate nohighlight\">\\((X,Y)\\)</span>. Vi kender ikke de sande fordelinger bag disse to variabler, men vi kan estimere dem med antagelser og data.</p><p>Lad <span class=\"math notranslate nohighlight\">\\(X\\)</span> og <span class=\"math notranslate nohighlight\">\\(Y\\)</span> v\u00e6re to stokastiske variabler, da er kovariansen mellem disse givet ved</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
